@rickasaurus @TooAngry @Dr_Keefer @acruiz Rare earth minerals require far more mining than coal.
Solar takes up far more space than nuclear and relies way too much on China.
It is apparently possible to extract uranium from sea water, but you probably need to use mined uranium to get the ball rolling, or an MSR.

@mikepompeo You know what else our military needs? Equipment. 
You know what that equipment runs with? Chips.
You know what happened when a bill was brought forward to manufacture chips in the US instead of relying on China? Republicans voted against it.

@TimothyDSnyder China has peaked?   LMAO

Sadly.....China makes approx 70% of America's needs Timmy.  From Chemicals to produce gasoline, batteries for EV's, 81% of all products WalMart sells is made in China. 87% on Amazon.   From Cancer drugs to baby aspirin. 

 You call that "peaking"?
